import React, { useEffect } from 'react'
import { useStateValue } from '../components/StateProvider'
import useWikiSearch from '../components/useWikiSearch';
import './SearchPage.css'
import Card from '../components/CardUI';

function SearchPage() {
  const [{term}, dispatch] = useStateValue();
  const {data} = useWikiSearch(term);
  let card = ''
  useEffect(()=>{
    for(let i=0; i<data[1]?.length();i++){
      console.log(data[1][i])
      card  += "<div className='col-md-9'> <div className='card text-center p-2 border-box-lg'> <div className='card-body text-dark'> <h4 className='card-title'>"+data[1][i]+"</h4> </div></div></div>";

    }
  },[data])

  return (
    <div className='searchPage'>
      <div className='searchPage__header'>
        {console.log(data)}
        {/* <Card /> */}
      </div>
      <div className='searchPage__header container-fluid d-flex justify-content-center'>
        <div className='row'>
          {card}
          <div className='col-md-9'>
          <div className='card text-center border-box-lg'>
            <div className='card-body text-dark'>
            <h4 className='card-title p-2'>Card Title</h4>
            </div>
          </div>
          </div>
        </div>
    </div>
      {/* <div className='searchPage__results'>
        <center><h1>{data[0]}</h1></center>
        <div className="card">
				<h2>{data[1][0]}</h2>
				<div className="line" style={{backgroundColor: "#fcd000"}}></div>
				<p>{data[3][0]}</p>
			</div>

      </div> */}
    </div>
  )
}

export default SearchPage
